import React from "react";
import "./NewPost.css";
import { MDBContainer, MDBRow, MDBCol, MDBInput, MDBBtn } from "mdbreact";
import CardCatalog from "../../global/components/front-end-comps/CardCatalog";

const NewPost = () => {
  const postSubmitHandler = (e) => {
    e.preventDefault();

    console.log();
  };

  return (
    <CardCatalog className="post-form">
      <MDBContainer>
        <MDBRow>
          <MDBCol>
            <form onSubmit={postSubmitHandler}>
              <p className="h5 mb-4">Create new post here:</p>
              <div className="grey-text">
                <MDBInput
                  id="location"
                  label="Location"
                  // icon="envelope"
                  group
                  type="text"
                  validate
                  error="wrong"
                  success="right"
                />
                <MDBInput
                  id="description"
                  className="post-desc"
                  label="Description"
                  // icon="lock"
                  group
                  type="textarea"
                  validate
                />
              </div>
              <div className="text-center rounded-0">
                <MDBBtn className="rounded-0 btn-success">POST</MDBBtn>
              </div>
            </form>
          </MDBCol>
        </MDBRow>
      </MDBContainer>
    </CardCatalog>
  );
};

export default NewPost;
